$(document).ready(function(){var e=new Bloodhound({remote:{url:UCF_FAQ_SEARCH.remote_path+"?search=%q",wildcard:"%q"},queryTokenizer:function(e){return Bloodhound.tokenizers.whitespace(e)},datumTokenizer:function(e){return Bloodhound.tokenizers.whitespace(e.title.rendered)}});$(".faq-typeahead").typeahead({minLength:3,highlight:!0},{name:"faq-search",limit:5,displayKey:function(e){return $("<span>").html(e.title.rendered).text()},source:e.ttAdapter()}).on("typeahead:selected",function(e,t){window.location=t.link})});